pragma solidity ^0.4.24;

import "./KomgoResolver.sol";
import "../lib/Sha3AddressLib.sol";

/**
 * @title KomgoMetaResolver contract
 * @author Fernando Garcia
 * @notice A resolver managed by Komgo with technical meta-data of a company.
 */
contract KomgoMetaResolver is KomgoResolver {

    // namehash('addr.reverse')
    bytes32 constant ADDR_REVERSE_NODE = 0x91d1777781884d03a6757a803996e38de2a42967fb37eeaca72729271025a9e2;

    event TextChanged(bytes32 _node, string _key, string _value);
    event EthPubKeyAdded(bytes32 _node, bytes32 _xPublicKey, bytes32 _yPublicKey, address _address, uint _termDate);
    event EthPubKeyRevoked(bytes32 _node, uint _index);
    event KomgoMessagingPubKeyAdded(bytes32 _node, string _pubKey, uint _termDate);
    event KomgoMessagingPubKeyRevoked(bytes32 _node, uint _index);
    event VaktMessagingPubKeyAdded(bytes32 _node, string _pubKey, uint _termDate);
    event VaktMessagingPubKeyRevoked(bytes32 _node, uint _index);
    event ReverseNodeChanged(bytes32 _node, bytes32 _reversedNode);

    string constant STATIC_ID = "staticId";
    string constant KOMGO_MNID = "komgoMnid";
    string constant VAKT_MNID = "vaktMnid";
    string constant X500_NAME = "x500Name";
    string constant NODE_KEYS = "nodeKeys";
    string constant PRODUCTS = "products";
    string constant VAKT_STATIC_ID = "vaktStaticId";
    string constant IS_DEACTIVATED = "isDeactivated";
    string constant HAS_SWIFTKEY = "hasSWIFTKey";
    string constant IS_FINANCIAL_INSTITUTION = "isFinancialInstitution";
    string constant IS_MEMBER = "isMember";
    string constant LEGAL_ENTITY_NAME = "legalEntityName";

    struct PublicKey {
        bytes32 x;
        bytes32 y;
    }

    struct EthPubKey {
        PublicKey publicKey;
        uint effDate;
        uint termDate;
        bool current;
        bool revoked;
    }

    struct MessagingPubKey {
        string key;
        uint effDate;
        uint termDate;
        bool current;
        bool revoked;
    }

    struct MetaRecord {
        mapping(string=>string) text;
        EthPubKey[] ethPubKeys;
        MessagingPubKey[] komgoMessagingPubKeys;
        MessagingPubKey[] vaktMessagingPubKeys;
        bytes32 reverseNode;
    }

    mapping (bytes32 => MetaRecord) metaRecords;

    /**
     * Adds a new ethereum public key key associated with an ENS node.
     * Increases the pointer of the current ethereum public key
     * May only be called by the owner of that node in the ENS registry.
     * @param _node The node to update.
     * @param _xPublicKey lower 32 bytes of the public key to add.
     * @param _yPublicKey higher 32 bytes of the public key to add.
     * @param _termDate Termination date of the key to add.
     */
    function addEthereumPublicKey(bytes32 _node, bytes32 _xPublicKey, bytes32 _yPublicKey, uint _termDate) public only_owner(_node) {
        PublicKey memory publicKey = PublicKey(_xPublicKey, _yPublicKey);
        // solium-disable-next-line security/no-block-members
        EthPubKey memory key = EthPubKey(publicKey, now, _termDate, true, false);
        if (metaRecords[_node].ethPubKeys.length > 0) {
            EthPubKey storage currentKey = metaRecords[_node].ethPubKeys[metaRecords[_node].ethPubKeys.length-1];
            currentKey.current = false;
        }
        metaRecords[_node].ethPubKeys.push(key);
        address addressFromPubKey = address(keccak256(abi.encodePacked(_xPublicKey, _yPublicKey)));
        bytes32 label = Sha3AddressLib.sha3HexAddress(addressFromPubKey);
        bytes32 reverseNode = keccak256(abi.encodePacked(ADDR_REVERSE_NODE, label));
        ens.setSubnodeOwner(ADDR_REVERSE_NODE, label, this);
        ens.setResolver(reverseNode, this);
        setReverseNode(reverseNode, _node);
        emit EthPubKeyAdded(_node, _xPublicKey, _yPublicKey, addressFromPubKey, _termDate);
    }

    /**
     * Adds a new Komgo messaging public key key associated with an ENS node.
     * Increases the pointer of the current messaging public key
     * May only be called by the owner of that node in the ENS registry.
     * @param _node The node to update.
     * @param _jwk JWK public key.
     * @param _termDate Termination date of the key to add.
     */
    function addKomgoMessagingPublicKey(bytes32 _node, string _jwk, uint _termDate) public only_owner(_node) {
        // solium-disable-next-line security/no-block-members
        MessagingPubKey memory key = MessagingPubKey(_jwk, now, _termDate, true, false);
        if (metaRecords[_node].komgoMessagingPubKeys.length > 0) {
            MessagingPubKey storage currentKey = metaRecords[_node].komgoMessagingPubKeys[metaRecords[_node].komgoMessagingPubKeys.length-1];
            currentKey.current = false;
        }
        metaRecords[_node].komgoMessagingPubKeys.push(key);
        emit KomgoMessagingPubKeyAdded(_node, _jwk, _termDate);
    }

    /**
     * Adds a new VAKT messaging public key key associated with an ENS node.
     * Increases the pointer of the current messaging public key
     * May only be called by the owner of that node in the ENS registry.
     * @param _node The node to update.
     * @param _jwk JWK public key.
     * @param _termDate Termination date of the key to add.
     */
    function addVaktMessagingPublicKey(bytes32 _node, string _jwk, uint _termDate) public only_owner(_node) {
        // solium-disable-next-line security/no-block-members
        MessagingPubKey memory key = MessagingPubKey(_jwk, now, _termDate, true, false);
        if (metaRecords[_node].vaktMessagingPubKeys.length > 0) {
            MessagingPubKey storage currentKey = metaRecords[_node].vaktMessagingPubKeys[metaRecords[_node].vaktMessagingPubKeys.length-1];
            currentKey.current = false;
        }
        metaRecords[_node].vaktMessagingPubKeys.push(key);
        emit VaktMessagingPubKeyAdded(_node, _jwk, _termDate);
    }

    /**
     * Revokes an ethereum public key (past present or future)
     * @param _node The node to update.
     * @param _index The index of the ethereum public key to revoke.
     */
    function revokeEthereumPublicKey(bytes32 _node, uint _index) public only_owner(_node) {
        metaRecords[_node].ethPubKeys[_index].revoked = true;
        emit EthPubKeyRevoked(_node, _index);
    }

    /**
     * Revokes a Komgo messaging public key (past present or future)
     * @param _node The node to update.
     * @param _index The index of the messaging public key to revoke.
     */
    function revokeKomgoMessagingPublicKey(bytes32 _node, uint _index) public only_owner(_node) {
        metaRecords[_node].komgoMessagingPubKeys[_index].revoked = true;
        emit KomgoMessagingPubKeyRevoked(_node, _index);
    }

    /**
     * Revokes a VAKT messaging public key (past present or future)
     * @param _node The node to update.
     * @param _index The index of the messaging public key to revoke.
     */
    function revokeVaktMessagingPublicKey(bytes32 _node, uint _index) public only_owner(_node) {
        metaRecords[_node].vaktMessagingPubKeys[_index].revoked = true;
        emit VaktMessagingPubKeyRevoked(_node, _index);
    }

    /**
     * Adds a reverse node associated to a node that would represent the reverse entry for an address
     * @param _node The node to update, that is a node for reverse addresses
     * @param _reverseNode The company node where the node belongs to
     */
    function setReverseNode(bytes32 _node, bytes32 _reverseNode) private {
        metaRecords[_node].reverseNode = _reverseNode;
        emit ReverseNodeChanged(_node, _reverseNode);
    }

    /**
     * Sets the text data associated with an ENS node and key.
     * May only be called by the owner of that node in the ENS registry.
     * @param node The node to update.
     * @param key The key to set.
     * @param value The text data value to set.
     */
    function setText(bytes32 node, string key, string value) public only_owner(node) {
        if(keccak256(key) == keccak256(STATIC_ID)){
            require(bytes(metaRecords[node].text[key]).length == 0, "Error: staticId is already set");
        }
        metaRecords[node].text[key] = value;
        emit TextChanged(node, key, value);
    }

    /**
     * Returns the text data associated with an ENS node and key.
     * @param node The ENS node to query.
     * @param key The text data key to query.
     * @return The associated text data.
     */
    function text(bytes32 node, string key) public view returns (string) {
        return metaRecords[node].text[key];
    }

    /**
     * Returns the current ethereum public key associated with an ENS node.
     * @param _node The ENS node to query.
     * @param _index The index of the signing key.
     * @return The signing key. Lower 32 bytes of public key, higher 32 bytes of public key, effDate, termDate, revoked
     */
    function currentEthereumPublicKey(bytes32 _node, uint _index) public view returns (bytes32, bytes32, uint, uint, bool, bool) {
        EthPubKey storage key = metaRecords[_node].ethPubKeys[_index];
        return (key.publicKey.x, key.publicKey.y, key.effDate, key.termDate, key.current, key.revoked);
    }

    /**
     * Returns the size of the ethereum public keys associated with an ENS node.
     * @param _node The ENS node to query.
     * @return The length of the ethereum public keys array.
     */
    function ethereumPublicKeysLength(bytes32 _node) public view returns (uint) {
        return metaRecords[_node].ethPubKeys.length;
    }

    /**
     * Returns the current Komgo messaging public key associated with an ENS node.
     * @param _node The ENS node to query.
     * @param _index The index of the messaging key.
     * @return The messaging JWK key, effDate, termDate, revoked
     */
    function currentKomgoMessagingPublicKey(bytes32 _node, uint _index) public view returns (string, uint, uint, bool, bool) {
        MessagingPubKey storage key = metaRecords[_node].komgoMessagingPubKeys[_index];
        return (key.key, key.effDate, key.termDate, key.current, key.revoked);
    }

    /**
     * Returns the size of the Komgo messaging keys associated with an ENS node.
     * @param _node The ENS node to query.
     * @return The length of the signing keys array.
     */
    function komgoMessagingPublicKeysLength(bytes32 _node) public view returns (uint) {
        return metaRecords[_node].komgoMessagingPubKeys.length;
    }

    /**
     * Returns the current VAKT messaging public key associated with an ENS node.
     * @param _node The ENS node to query.
     * @param _index The index of the messaging key.
     * @return The messaging JWK key, effDate, termDate, revoked
     */
    function currentVaktMessagingPublicKey(bytes32 _node, uint _index) public view returns (string, uint, uint, bool, bool) {
        MessagingPubKey storage key = metaRecords[_node].vaktMessagingPubKeys[_index];
        return (key.key, key.effDate, key.termDate, key.current, key.revoked);
    }

    /**
     * Returns the size of the VAKT messaging keys associated with an ENS node.
     * @param _node The ENS node to query.
     * @return The length of the signing keys array.
     */
    function vaktMessagingPublicKeysLength(bytes32 _node) public view returns (uint) {
        return metaRecords[_node].vaktMessagingPubKeys.length;
    }

    /**
     * Returns the reverse node associated with an ENS node for reverse lookups of addresses
     * @param _node The ENS node to query
     * @return The company node associated to the address _node
    */
    function reverseNode(bytes32 _node) public view returns(bytes32) {
        return metaRecords[_node].reverseNode;
    }

    /**
     * Returns the staticId associated with an ENS node.
     * @param _node The ENS node to query.
     * @return The associated staticId
     */
    function staticId(bytes32 _node) public view returns (string) {
        return metaRecords[_node].text[STATIC_ID];
    }

    /**
     * Returns the Komgo MNID queue associated with an ENS node.
     * @param _node The ENS node to query.
     * @return The associated Komgo MNID.
     */
    function komgoMnid(bytes32 _node) public view returns (string) {
        return metaRecords[_node].text[KOMGO_MNID];
    }

    /**
     * Returns the VAKT MNID queue associated with an ENS node.
     * @param _node The ENS node to query.
     * @return The associated VAKT MNID.
     */
    function vaktMnid(bytes32 _node) public view returns (string) {
        return metaRecords[_node].text[VAKT_MNID];
    }

    /**
     * Returns the X500 Name associated with an ENS node.
     * @param _node The ENS node to query.
     * @return a string formatted as a JSON array of the associated nodes public keys.
     */
    function x500Name(bytes32 _node) public view returns (string) {
        return metaRecords[_node].text[X500_NAME];
    }

    /**
     * Returns the node keys associated with an ENS node.
     * @param _node The ENS node to query.
     * @return a string formatted as a JSON array of the associated nodes public keys.
     */
    function nodeKeys(bytes32 _node) public view returns (string) {
        return metaRecords[_node].text[NODE_KEYS];
    }

    /**
     * Returns the JSON string with all products
     * @param _node The ENS node to query
     */
    function products(bytes32 _node) public view returns(string) {
        return metaRecords[_node].text[PRODUCTS];
    }

    /**
     * Returns the VAKT static ID
     * @param _node The ENS node to query
     */
    function vaktStaticId(bytes32 _node) public view returns(string) {
        return metaRecords[_node].text[VAKT_STATIC_ID];
    }

    /**
     * Returns the isDeactivated value
     * @param _node The ENS node to query
     */
    function isDeactivated(bytes32 _node) public view returns(string) {
        return metaRecords[_node].text[IS_DEACTIVATED];
    }

    /**
     * Checks if the company has SWIFT key
     * @param _node The ENS node to query
     * @return true if the company has SWIFT key
    */
    function hasSWIFTKey(bytes32 _node) public view returns(string) {
        return metaRecords[_node].text[HAS_SWIFTKEY];
    }

    /**
     * Checks if the company is a financial institution
     * @param _node The ENS node to query
     */
    function isFinancialInstitution(bytes32 _node) public view returns(string) {
        return metaRecords[_node].text[IS_FINANCIAL_INSTITUTION];
    }

    /**
     * Checks if the company is a member
     * @param _node The ENS node to query
     */
    function isMember(bytes32 _node) public view returns(string) {
        return metaRecords[_node].text[IS_MEMBER];
    }

    /**
     * Returns the legal entity name of the company
     * @param _node The ENS node to query
     */
    function legalEntityName(bytes32 _node) public view returns(string) {
        return metaRecords[_node].text[LEGAL_ENTITY_NAME];
    }
}

